import React from "react";
import dummyData from "../dummy-data";
import SearchBox from "./search";

export default function List(){ 
    return(
        <div>   
        {
            props.dummyData.map(list => {
                <div>
                    {list.id}
                    {list.title}
                    {list.content}
                </div>                 
            })
        }
            <button>Edit</button>
            <button>Delete</button>
        </div>
    );
};
